import React, { useState, useEffect } from 'react'

import {
  CCard,
  CCardBody,
  CCardHeader,
  CRow,
  CCol,
  CButton,
  CSelect,
  CDataTable,
  CBadge,
  CSpinner,
  CImg,
  CModal,
  CModalBody,
} from '@coreui/react'

import img from '../../../assets/img-solar.jpg'


const SolarBattery = () => {


  return (
    <div className="position-relative">
        <CImg
            width={'100%'}
            src={img}
            alt=""
            className={'img-placeholder-full'}
            style={{marginLeft:'-30px',marginTop:'-2rem',width:'106%'}}
        />
        <CModal
            className="show d-block position-absolute"
            backdrop={false}
            keyboard={false}
            portal={false}
            visible
            >
            <CModalBody>Coming June 2022</CModalBody>
        </CModal>
    </div>


    //   <CCard className="mb-4">

    //   <CCardHeader>
    //       <CRow>
    //         <CCol sm="6">
    //           <h3 id="diagnostics" className="card-title mb-0">
    //             AI Analytics - Energy Generation
    //           </h3>
    //           {/* <div className="small text-medium-emphasis">{getDateLabel(dateRange)}</div> */}
    //         </CCol>            
    //       </CRow>

    //     </CCardHeader>

    //     <CCardBody>

              
    //     <CRow className="mb-4">
    //       <CCol>
    //         <h4 className='text-center'>Wind Turbines for investigation/resolution: 3</h4>
    //         <CImg
    //           width={'100%'}
    //           src={img}
    //           alt=""
    //           className={'mt-3'}
    //         />

    //       </CCol>
    //     </CRow>

          
    //     </CCardBody>

    //   </CCard>



  )
}

export default SolarBattery
